import dice from '../data'

class Dice extends Component {
    constructor(props){  
        super(props);  
        this.state = {  
             dice: dice  
          }
        } 
    componentDidMount(){

    }
    render(){
        return(
            this.state.dice.map((die,index) => {
            return (
                <div>
                    {index+1} - {die}
                </div>
            )
            })
        )
    }
}

